[LevelNotNumeric]
en="Skipping line in config as level $level is not numeric."

[LevelSet]
en="#green$steamid#default is now level #green$level#default."

[AdminStart]
en=" ** Start of admin list."

[AdminItem]
en="$steamid -- $name ($level)"

[AdminEnd]
en=" ** End of admin list."

[AdminExists]
en="Cannot add admin #green$steamid#default, admin already registered."

[InvalidAdmin]
en="Command failed: #green$steamid#default is not an admin."

[AdminRemoved]
en="Removed admin #green$steamid#default."

[AddedAdmin]
en="Registered admin $steamid -- $name ($level)"

[NotAdmin]
en="You are not an admin."

[InsufficientPriviledges]
en="You have insufficient priviledges to run this command."